import React from 'react';
import ReactDOM from 'react-dom';

function MyThing() {
    return (
        <div className='book'>
          <div className='title'>
	    The Title
 	  </div>
          <div className='author'>
	    The Author
          </div>
          <ul className='stats'>
	    <li className='rating'>
	      5 starrs
	    </li>
            <li className='isbn'>
              12-345678-910
            </li>
          </ul>
          <div>
            &nbsp;Non-&nbsp;breaking
            &nbsp;Spaces&nbsp;&nbsp;
          </div>
        </div>
    );
}

ReactDOM.render(
    <MyThing/>,
    document.getElementById('root'),
);
